INSERT INTO components_restaurant_information VALUES(1,'Come and surround yourself in vibrant dcor, progressive architecture and an innovative creative vibe at Latitude 15, Lilongwe.');
INSERT INTO components_restaurant_information VALUES(2,'We take pride in the products that we use, supporting local suppliers for fresh and organic ingredients always.');
INSERT INTO components_restaurant_information VALUES(3,'Come for the view, Stay for the food! Breath-taking, panoraic views of SanFrancisco, Golden-Gate Bridge, Alcatraz and Bay Bridge!');
INSERT INTO components_restaurant_information VALUES(4,'Californian contemporary cuisine, serving a nightly tasting menu that highlights the best of Northern California''s seasonal bounty and the restaurant''s unique partnership with Fresh Run Farm.');
INSERT INTO components_restaurant_information VALUES(5,'Rusconi''s American Kitchen features hand crafted regional American cuisine by Chef Michael Rusconi.');
INSERT INTO components_restaurant_information VALUES(6,'Our Steak & BBQ restaurants are not only famous for delicious food, but also our fast and personable service whether dining in or at a venue of your choice.');
INSERT INTO components_restaurant_information VALUES(7,'Summer cocktails with Saigon''s best view of Ho Chi Minh City');
INSERT INTO components_restaurant_information VALUES(8,'Essence Restaurant is the perfect choice for fine dining in Vietnam focusing on Vietnamese menu with a touch of European influence.');
INSERT INTO components_restaurant_information VALUES(9,'We cook and deliver Crimean Tatar kitchen dishes in Kyiv. Delivery is free of charge for most of Kyiv.');
INSERT INTO components_restaurant_information VALUES(10,'Local & Japanese classics including sushi, borscht & dumplings are served at this romantic eatery.');
INSERT INTO components_restaurant_information VALUES(11,'Banquet halls for rent in Moscow, near the metro, private parking, large wine list, excellent menu, discounts for all visitors');
INSERT INTO components_restaurant_information VALUES(12,'Belgian brasserie, with plenty of fresh beers and a good selection of wines and snacks.');
INSERT INTO components_restaurant_information VALUES(13,'Ferdinand the Bull is yet another symbol for peace, simplicity and happiness.');
INSERT INTO components_restaurant_information VALUES(14,'A Lebanese success story since 1961. Seafood in Lebanon.');
INSERT INTO components_restaurant_information VALUES(15,'Inspired by the flavors and cultures of La Antigua, Guatemala, Porta Hotel Antigua provides guests with an authentic dining experience worthy of our vibrant surroundings.');
INSERT INTO components_restaurant_information VALUES(16,'La Bruja is a space that combines alternative food and drinks with books, games, good music and nature in a historic corner of Antigua Guatemala.');
INSERT INTO components_restaurant_information VALUES(17,'Restaurant Pur - Jean-Franois Rouquette. This restaurant located in the Park Hyatt Paris-Vendme palace, has held one star in the Michelin guide since 2008.');
INSERT INTO components_restaurant_information VALUES(18,'On the menu of Instinct, bistronomy! Homemade cuisine, seasonal products, colorful, tasty and above all gourmet dishes!');
INSERT INTO components_restaurant_information VALUES(19,'Au menu d''Instinct, de la bistronomie ! Cuisine maison, produits de saison, plats colors, savoureux et surtout gourmands !');
INSERT INTO components_restaurant_information VALUES(20,'Nos restaurants Steak & BBQ ne sont pas seulement rputs pour leur cuisine dlicieuse, mais aussi pour notre service rapide et personnalis, que vous dniez  l''intrieur ou dans un lieu de votre choix.');
INSERT INTO components_restaurant_information VALUES(21,'Des plats locaux, du bortsch et des raviolis sont servis dans ce restaurant romantique.');
INSERT INTO components_restaurant_information VALUES(22,'Le restaurant Essence est le choix parfait pour une cuisine raffine au Vietnam en se concentrant sur un menu vietnamien avec une touche d''influence europenne.');
INSERT INTO components_restaurant_information VALUES(23,'Ferdinand le Taureau est encore un autre symbole de paix, de simplicit et de bonheur.');
INSERT INTO components_restaurant_information VALUES(24,'La Bruja est un espace qui combine des aliments et des boissons alternatifs avec des livres, des jeux, de la bonne musique et de la nature dans un coin historique d''Antigua Guatemala.');
INSERT INTO components_restaurant_information VALUES(25,'Venez vous entourer d''un dcor vibrant, d''une architecture progressive et d''une ambiance crative innovante au Latitude 15, Lilongwe.');
