INSERT INTO components_shared_question_answers VALUES(79,'Can I fully customize FoodAdvisor on my machine?','**Yes!** FoodAdvisor is public on [Github](https://github.com/strapi/foodadvisor). Feel free to fully customize it on your own machine. Also, since it contains the [Data Transfer](https://docs.strapi.io/dev-docs/data-management/transfer) feature, you can transfer the data of this hosted demo to your local instance of FoodAdvisor if you wish spend more time on it. You can follow the steps on the [documentation](https://docs.strapi.io/dev-docs/data-management/transfer) page.');
