INSERT INTO components_shared_question_answers VALUES(87,'Puis-je personnaliser entirement FoodAdvisor sur ma machine ?','**Oui!** FoodAdvisor est public sur [Github](https://github.com/strapi/foodadvisor). N''hsitez pas  le personnaliser entirement sur votre propre machine. De plus, comme il contient la fonction [Transfert de donnes](https://docs.strapi.io/dev-docs/data-management/transfer), vous pouvez transfrer les donnes de cette dmo hberge vers votre instance locale de FoodAdvisor si vous souhaitez passer plus de temps dessus. Vous pouvez suivre les tapes sur la page [documentation](https://docs.strapi.io/dev-docs/data-management/transfer).');
INSERT INTO components_shared_question_answers VALUES(88,'Cette FAQ fait-elle partie d''une dynamic zone?',replace('**Oui !** Cette FAQ fait partie d''une catgorie **blocks** dans Strapi. Le Collection-type `Page` contient une dynamic zone **blocks** qui inclut ce composant FAQ.\nCela signifie que vous pouvez insrer dynamiquement un nombre infini de FAQ sur cette page ','\n',char(10)));
INSERT INTO components_shared_question_answers VALUES(89,'Cela signifie-t-il que je peux personnaliser les sections de cette page?','**Oui !** Incluez simplement les composants que vous souhaitez ajouter  votre dynamic zone de votre Collection-type `Page` (blocks), ajoutez vos donnes et vous tes prt c''est partie !');
INSERT INTO components_shared_question_answers VALUES(90,'Puis-je crer des pages  la vole ?','**Absolument !** Le Collection-Type `Page` vous permet de crer des pages  la vole avec une liste dfinie de composants. Essayez de crer une page `/about` par exemple ');
INSERT INTO components_shared_question_answers VALUES(91,'How this demo globally works?','This demo contains two applications: A Strapi and a Next.js one. The content is created and delivered by Strapi. On the other side, this Next.js application simply fetch the data from Strapi and display it right here. Next.js is using [SSR](https://nextjs.org/docs/basic-features/pages#server-side-rendering) to fetch the data (need to reload to see content updates from Strapi) but you can absolutety use SSG, this is what we do on our [strapi.io](https://strapi.io) website  ');
INSERT INTO components_shared_question_answers VALUES(92,'Is there some customizations just for this demo?',replace('**Yes**! In fact, please find the list below of the customizations that have been done for the purpose of this demo. **These customizations won''t be there in a default project** but it is very easy to have them:\n\nThe following plugins were added: [SEO](https://market.strapi.io/plugins/@strapi-plugin-seo), [Calendar](https://market.strapi.io/plugins/@offset-dev-strapi-calendar), [Scheduler](https://market.strapi.io/plugins/@webbio-strapi-plugin-scheduler), [strapi-plugin-populate-deep](https://market.strapi.io/plugins/strapi-plugin-populate-deep), and the [Todo](https://market.strapi.io/plugins/strapi-plugin-todo) \n\nAlso, a [Ckeditor 5 custom field](https://github.com/ckeditor/strapi-plugin-ckeditor) has been added to the `article` content type for writing the content of it.\n\n 2 admin extensions were added: \n  - **A Preview button**. Only working with the Next.js preview system, this button will appear on your restaurants, articles, and pages editView in the right section allowing you to preview them on your front-end.\n  - **A Tweet button**. This button will appear on your restaurants, and articles editView in the right section allowing you to share a tweet about this content.','\n',char(10)));
INSERT INTO components_shared_question_answers VALUES(93,'How many components can we nest in Strapi?','Using the UI, you can nest 2 components only. However, by directly modifying the JSON file of the parent component, you can nest way more! This is not something we encourage to do but this is possible. In fact, the `footer` component of the Global single-type contains a `footerColumns` component that itself contains a `links` repeatable component ');
INSERT INTO components_shared_question_answers VALUES(94,'What if something is broken on Next.js?',replace('Strapi is an headless CMS. It is completely dissociated from the front-end application which is Next.js here. Everything can work like a charm on the Strapi side but not on the front-end side, and vice-versa. There could have been an infinite number of possible Next.js application fetching the data of this Strapi application and some of them would have been better than some others. \nThis front-end app is not perfect, but simple enough to demonstrate how a simple client application can work with Strapi.\n\nIf you face any issues during your demo trial, please, feel free to [submit a GitHub issue to the project](https://github.com/strapi/foodadvisor/issues).','\n',char(10)));
INSERT INTO components_shared_question_answers VALUES(95,'What if my demo is slow?',replace('If you requested a demo on our [website](https://strapi.io/demo) it is normal. Compared to what we can see in our ecosystem, we want to deliver a unique demo for everyone so that they can personalize it as much as they want. However, these demos run on the cloud (AWS) with **limited resources**  \n\nFeel free to [fork this application](https://github.com/strapi/foodadvisor/fork) and to deploy the Strapi app (`api` folder) on [Strapi Cloud with our 14 days free trial](https://strp.cc/45D3e2F).\n','\n',char(10)));
INSERT INTO components_shared_question_answers VALUES(96,'What does the blue Strapi badge represent on the demo?','This is a little helper that shows you which Dynamic zone component is being displayed on the frontend  There is also a link to the corresponding entry in Strapi!');
