INSERT INTO restaurant_pages VALUES(1,'restaurants','Category','Place',9,1637683286782,1685702166950,1639184706795,NULL,1,'en');
INSERT INTO restaurant_pages VALUES(2,'restaurants','Categorie','Endroit',9,1637683337305,1685702166973,1637683340258,NULL,1,'fr-FR');
INSERT INTO reviews VALUES(1,'Absolutely stunning interior of the hotel, decked out like a museum its possible to transport you to the Zanzibar coast in the middle of lusaka! Its really a treat to stop here a while and feast your eyes over the decor with a delicious cappuccino',5,1636469860697,1636470561875,NULL,NULL,'en');
INSERT INTO reviews VALUES(2,'Surprisingly spacious property in the heart of residential surburb. Parking can be a bit tight if busy particularly in the evening. Interesting decor as with the other latitudes. 2 swimming pools and eating areas with different feels. Service was slow delicious strawberry daiquiri but rib eye was really really tough and was a disappointment. Gives home feel compared to large brand hotels.',3,1636469860701,1636470600335,NULL,NULL,'en');
INSERT INTO reviews VALUES(3,'I''ll start by saying that I was initially very excited to visit the restaurant at Latitude 15. I am visiting Zambia on holiday for the first time and looked forward to a nice dinner during my stay, only to be extremely frustrated with my experience at the restaurant. My friend and I tried to order 5 different items from the menu, just to be told that they were unavailable (a liquor option, the pork chops, calamari, crayfish gratin, and a dessert option).',2,1636469860702,1636470620933,NULL,NULL,'en');
INSERT INTO reviews VALUES(4,replace('I need to rave about the Seafood vol au vent! Firstly, there is something about having and entire vol au vent as the main meal and not just a small one as a starter!\nI titled my review "choreography in the mouth" because that''s how the different ingredients "dance" together in ones mouth, the fish, the shrimp, the calamari, layered in light pastry on a bed of sweet potato and spinach topped with a creamy sauce ! Writing about it makes me salivate!\nThank you!','\n',char(10)),5,1636469860704,1636471095729,NULL,NULL,'en');
INSERT INTO reviews VALUES(5,'Possibly the most stylish venue in Lusaka and a choice of either eating in the restaurant or at The Other Side by their second pool. Friendly if somewhat erratic service, food good and well presented.',5,1636469860706,1636471114383,NULL,NULL,'en');
INSERT INTO reviews VALUES(6,'The service at this restaurant was fantastic, I took my group of 15 with some VIP guests as well here and I was not disappointed. Highly recommended. So many menu options and lovely food.',5,1636469860707,1636471169055,NULL,NULL,'en');
INSERT INTO reviews VALUES(7,'Best salads in Lusaka. Cozy place and great service. They also have a good range of yummy pastries and drinks, cold or hot. I highly recommend for salad lovers like me.',5,1636469860708,1636471191950,NULL,NULL,'en');
INSERT INTO reviews VALUES(8,'Has both indoor and outdoor sections. Decent menu at reasonable prices. Focuses mainly on burgers, wraps and sandwiches. Decent service. Food was tasty. I asked for a slight variation on the standrd dish (swapping halloumi cheese for chicken on one salad dish) and this was no problem.',4,1636469860710,1636471229989,NULL,NULL,'en');
INSERT INTO reviews VALUES(9,'Mint is a great restaurant serving great food. The chicken, feta, avocado and apple salad is definitely one to try out. So delicious.',5,1636469860712,1636471243893,NULL,NULL,'en');
INSERT INTO reviews VALUES(10,'Very pleasant welcome.Quick Service. Very busy at lunch time. Food is fresh and well presented.Within a complex so parking difficult. We all had different dishes, but all came together. In a noisy area, but the restaurant was in a nice garden.',4,1636469860714,1636471255948,NULL,NULL,'en');
INSERT INTO reviews VALUES(11,'The location and view are phenomenal. The food is delicious. Definitely, a must-do experience. MeeSun was a fabulous host and a treasure.',5,1636469860716,1636471350210,NULL,NULL,'en');
INSERT INTO reviews VALUES(12,'A nice change of pace from downtown San Francisco. The food and service were very good and the atmosphere was terrific. The views of the area were awesome. A very nice casual place to relax and enjoy the area.',5,1636469860718,1636471367437,NULL,NULL,'en');
INSERT INTO reviews VALUES(13,'Aside from the obvious fantastical views of SF Bay, the food & drinks were on point. We got the tacos & fries, which well exceeded our expectations. We met the owner, Mesun, who couldnt be nicer and took fantastic photos of us; its clear shes done it many times before.',5,1636469860720,1636471380489,NULL,NULL,'en');
INSERT INTO reviews VALUES(14,'What a cool spot! I attended a friend''s 40th birthday dinner + drinks here and I''m glad I discovered this gem in the bay (quite literally). The food and cocktails were delicious, especially their guacamole. The owner and staff were super friendly, too. We were able to have the restaurant (and the accompanying bocce ball & mini golf areas) to ourselves after they closed to the public, which was a real treat.',5,1636469860722,1636471392463,NULL,NULL,'en');
INSERT INTO reviews VALUES(15,'Mersea is an awesome venue with stunning views of SF, amazing food, and a super casual outdoor vibe with many activities. The service was top-notch, and MeeSun (the owner) was over the top accommodating to our entire team. We''ll definitely be planning another outing soon!!',5,1636469860724,1636471404122,NULL,NULL,'en');
INSERT INTO reviews VALUES(16,replace('The whole experience was fabulous and food/wine true to 3 michelin stars....\nThe staff knew in depth what they were serving and giving you an insight on what you were about to taste..\nPerfect evening filled with phenomenal food, marvelously presented with a unique story to each course.','\n',char(10)),5,1636469860725,1636471416484,NULL,NULL,'en');
INSERT INTO reviews VALUES(17,'You cant visit San Miguel and not visit Quince. The service and the food are amazing. I couldnt get enough of the view. Our waiter, Oswaldo was very attentive and took care of us great! We were very impressed with his service. I would def be back to Quince!',5,1636469860726,1636471427786,NULL,NULL,'en');
INSERT INTO reviews VALUES(18,'This has to be one of the finest dinning restaurants I''ve every had the pleasure to dine at. The food was splendid and me and my wife enjoyed the entire experience.',5,1636469860727,1636471446372,NULL,NULL,'en');
INSERT INTO reviews VALUES(19,'I suspect that the founding father chef Mike Tusk isn''t in the kitchen. The meal started with a vaguely grotesque buddha''s hand stuffed with raw fish, and went course by course from there, many things just didn''t hit the superb dishes from before. The food was vaguely strange, but all was good the service was astounding, as was the place.',4,1636469860729,1636471460111,NULL,NULL,'en');
INSERT INTO reviews VALUES(20,'We celebrated a special occasion here in Sep 2019. The food was fresh, awesome and delicious. Really enjoyed the 2 desserts! We were amazed at the range of mignardise on the cart as well. We truly appreciate the attentive, thoughtful and wonderful service. This dining experience has been added to my treasure trove of special memories. Kudos and thanks to Quince!',5,1636469860731,1636471473179,NULL,NULL,'en');
INSERT INTO reviews VALUES(21,'We had a great time. It was AZ Restaurant week. The scallops were amazing. Loved the cheesecake. The carmelized bananas were a nice touch. Rex our server did a great job.',5,1636469860734,1636471515198,NULL,NULL,'en');
INSERT INTO reviews VALUES(22,'We loved it. Tables spaced out well. Not too loud. Every item we tried was fantastic. Great service.',5,1636469860736,1636471526165,NULL,NULL,'en');
INSERT INTO reviews VALUES(23,'Who really remembers the succulent roasted chicken (which you must reserve in advance -- they only have a limited number of portions each day) when the show stopper at Rusconi''s is the green chili mac ''n cheese? OMG! I ordered a small side dish of the mac and could have enjoyed 3 or 4 portions of it. It''s THAT good!',5,1636469860737,1636471537023,NULL,NULL,'en');
INSERT INTO reviews VALUES(24,'The food that we ordered came with a beautiful combination of presentation, texture and taste. The entire meal was very enjoyable.',4,1636469860738,1636471550231,NULL,NULL,'en');
INSERT INTO reviews VALUES(25,'We ordered take-out for our family of five and each entree was tasty and creative. Little surprises also came with the order--some delicious brownie squares and then a thank-you call the next day. This place has class. A Definite keeper and we''ll be back.',5,1636469860739,1636471562359,NULL,NULL,'en');
INSERT INTO reviews VALUES(26,'I am Bob Sikora alumni from Bobby McGee''s mesa. Bobby Q''s awesome food. Brought back memories. Would highly recommend to everyone. The cajun shrimp was excellent. Was a favorite of mine at mesa store. Do you all sell the Cajun ingredients so I can make this at home? Would love to make this and add to dishes at home. Bobby Q cajun spice.',5,1636469860741,1636471574871,NULL,NULL,'en');
INSERT INTO reviews VALUES(27,'The staff was friendly, the ribs slipped right off of the bone, the mac and cheese was impressive. The restaurant was a little dark (lighting).',5,1636469860742,1636471594123,NULL,NULL,'en');
INSERT INTO reviews VALUES(28,'Ordered dinner for pick up on way back from a day trip to Montezuma''s Castle. Ordering was easy. Our teenaged son ordered a burger, we shared wings (prepared dry but served with different sauces), I had a chicken salad and my husband had the brisket sandwich. We can see why Bobby Q has 3 locations- all of our food was very tasty-different from the Kansas style we are used to, but all meats were flavorful, tender and juicy,',4,1636469860743,1636471613157,NULL,NULL,'en');
INSERT INTO reviews VALUES(29,'Great variety of bbq''s meats and sides. Meats aren''t over sauced. Cute outdoor patio. Friendly staff. They bring out delicious corn bread muffins before your meal',4,1636469860745,1636471641227,NULL,NULL,'en');
INSERT INTO reviews VALUES(30,'We went here while visiting our daughter at GCU. Sat night was to to busy, so we went Mon. All meats were solid, although I don''t care for sauce already on the meats, and the beans were ok. The Ribeye''s were good. Good sides. Good Chicken, Ribs, Sausage. Great service. Great atmosphere',5,1636469860747,1636470312241,NULL,NULL,'en');
INSERT INTO reviews VALUES(31,'Great cocktails, great food, great music and it all comes with a great view. Do not miss this place!',5,1636469860750,1636471767685,NULL,NULL,'en');
INSERT INTO reviews VALUES(32,'At the 10th floor. Very nice view of Ho Chi Minh city at night. Romantic vibe good for dates. Mostly expats customers. DJ playing when we went Friday evening. Dancing allowed. We had fun and we would love to come back.',5,1636469860752,1636471780111,NULL,NULL,'en');
INSERT INTO reviews VALUES(33,'Super chilled rooftop with amazing view of the city. Good DJ and great cocktail, combined with good burger.',5,1636469860753,1636471790543,NULL,NULL,'en');
INSERT INTO reviews VALUES(34,'Amazing place, drinks and food are good and the services is friendly and attentive. We have been there few time already and its a great place to chill on the week and party on the week end! Super sunset!',5,1636469860755,1636471800829,NULL,NULL,'en');
INSERT INTO reviews VALUES(35,'Come here first time after live in Saigon almost 2year, all prefect. amazing place, best service. Sure we will back .',5,1636469860756,1636471814587,NULL,NULL,'en');
INSERT INTO reviews VALUES(36,'Loved this restaurant both the set menu Western food and the service. Large, tender Australian tenderloin, one of the best...dessert was spectacular...enjoyed everything',5,1636469860757,1636470426206,NULL,NULL,'en');
INSERT INTO reviews VALUES(37,'We stayed at this hotel and ate here every morning. The array of dishes was vast and we never tried anything we didn''t like. We ate dinner here one night and it was very good, too. Solid bet!',5,1636469860758,1636470380678,NULL,NULL,'en');
INSERT INTO reviews VALUES(38,'We had a great dinner at Esscence restaurant. The food is super delicious with local taste and the service is excellent. Highly recommend!',5,1636469860760,1636470456319,NULL,NULL,'en');
INSERT INTO reviews VALUES(39,replace('I was delighted to find that this restaurant had an excellent gluten-free menu for dinner, so there was no issue with explaining my dietary requirement. The food was very good, although the portions weren''t large. The breakfast buffet was extensive and had plenty of GF options.\nAll the staff were exceptionally helpful and friendly; Sarah and Mint deserve special mention.','\n',char(10)),5,1636469860761,1636471897037,NULL,NULL,'en');
INSERT INTO reviews VALUES(40,'The food was so good we moved our hotel accommodation to get in on their included breakfast. We were especially impressed with Alex and Emma who were part of the restaurant wait staff.',5,1636469860762,1636471923707,NULL,NULL,'en');
INSERT INTO reviews VALUES(41,'I would like to thank our waiter Ilias for being attentive and polite. A good place to come to for lunch. Good food and affordable prices',5,1636469860764,1636471941890,NULL,NULL,'en');
INSERT INTO reviews VALUES(42,'It''s one of the best restaurants I''ve visited in Kyiv! The food is very delicious and the quality of the service is great. A special thanks for our waiter Ilyas!',5,1636469860765,1636471950939,NULL,NULL,'en');
INSERT INTO reviews VALUES(43,'The meals was perfect and ILYAS is very kind to us as a waiter .Try to its national rice(pilav) meal.',5,1636469860767,1636471961623,NULL,NULL,'en');
INSERT INTO reviews VALUES(44,'The place is awesome, good service and the food is delicious! The atmosphere is very nice and friendly.',5,1636469860769,1636471972377,NULL,NULL,'en');
INSERT INTO reviews VALUES(45,'Sells Aleikum! Last night I was visited by Musafir on the Rognedinsky. We got great pleasure. The kitchen is as always on top, the atmosphere is cozy and relaxing to rest and communicating. Special thanks to the waitress Shekera for excellent service.',5,1636469860771,1636471984017,NULL,NULL,'en');
INSERT INTO reviews VALUES(46,'As a writer Chekhov said about human being: everything should be beautiful, the same I can say about this fabulous restaurant. I came there with my teenage daughter and both of us had a wonderful time. We ordered borsh soup, Olivie salad, shared ribeye, pelmeni, sweet vareniki and smetannik. I tried their house nastoika, after which I bought 4 bottles of it for souvenirs to take back home. The food was tasty, especially I would recommend the deserts. The service by waiter Igor was more than just excellent but also quite rare for Kharkiv.',5,1636469860774,1636472020097,NULL,NULL,'en');
INSERT INTO reviews VALUES(47,'Delicious food and lovely service. We enjoyed a full dinner, from cocktails to dessert and enjoyed everything served. Highly recommend.',5,1636469860775,1636472050758,NULL,NULL,'en');
INSERT INTO reviews VALUES(48,'We had different plates and all was very nicely presented and of excellent quality. The veal was extraordinary and one of the best I''ve eaten in a dcade. The Napoleon cake is amazing, must eat!! Bravo ana a place I''ll return and remember.',5,1636469860777,1636472083376,NULL,NULL,'en');
INSERT INTO reviews VALUES(49,'Delicious food, especially rabbit cotlets, pate and Cheescake (dont remeber the name of that desert). One day service was perfect in other there was some problems, dont know why, but i can highly recomend that restaurant.',4,1636469860778,1636472122620,NULL,NULL,'en');
INSERT INTO reviews VALUES(50,'Great place. Delicious food. Just in the heart of the city. Pricesare quite high, butthe food really costs such money,',5,1636469860779,1636472149649,NULL,NULL,'en');
INSERT INTO reviews VALUES(51,'One of the best restaurant , every one have to visit, the food and the services are great- Romantic Place.',5,1636469860781,1636472165434,NULL,NULL,'en');
INSERT INTO reviews VALUES(52,'I was in the area for a meeting and went there for dinner with live piano music. Enjoyable classy atmosphere, good service and super food.',5,1636469860783,1636472173689,NULL,NULL,'en');
INSERT INTO reviews VALUES(53,'In this restaurant we listened to good music, we ate well, the staff was very good and very good value for money.',5,1636469860784,1636472183294,NULL,NULL,'en');
INSERT INTO reviews VALUES(54,'Excellent food, cosy atmosphere, perfect service, friendly staff, nice live music. Good value for money We loved it!',5,1636469860786,1636472194269,NULL,NULL,'en');
INSERT INTO reviews VALUES(55,'Friends of ours from Moscow took us to this restaurant. The service was impeccable. Our friend wanted us to try a special vodka and they didn''t carry it so our server walked down the street and bought a bottle. The food was incredible. I had the salmon and it was delicious. My husband loved his steak. They have an extensive wine menu as well. They offer a menu in English if you don''t speak Russian. I would highly recommend this place.',5,1636469860787,1636472207924,NULL,NULL,'en');
INSERT INTO reviews VALUES(56,'Good place to enjoy a late summer afternoon. The street is quite during august, few tables are arranged on the street, good snacks and cocktails. Service is nice and quick.',4,1636469860788,1636472233364,NULL,NULL,'en');
INSERT INTO reviews VALUES(57,'It''s a great place to drink a best of belgian beer and eat delicious food. Home environment, pleasant prices and polite waiters its all about that restaurant. I will back here again coze in Moscow not enough good belgian places like this one.',5,1636469860790,1636472261569,NULL,NULL,'en');
INSERT INTO reviews VALUES(58,'My new top-3 place in Presnya. Cozy interior, attentive staff and a selection of favorite Belgian specimen. High quality reading included.',5,1636469860791,1636472284288,NULL,NULL,'en');
INSERT INTO reviews VALUES(59,'Its a wonderful place in my favorite Moscowcity, like little Belgium Its one of my lovely place I really recommend this cafe! A specially after hard work day or after  I dont know maybe walk, or just for fun ',5,1636469860793,1636472310005,NULL,NULL,'en');
INSERT INTO reviews VALUES(60,'Awesome beer and scrumptious snacks! Super cosy place with hospital waiters and nice public. Belgium atmosphere never leaves you here. Recommend to visit!',5,1636469860795,1636472338793,NULL,NULL,'en');
INSERT INTO reviews VALUES(61,'Lovely bar in Hamra with very nice drinks, variety and a very happy service!!! Definitely worths visiting for the laid back atmosphere and the cocktails! Excellent Negroni!!! Shukran guys!!!',5,1636469860797,1636472364858,NULL,NULL,'en');
INSERT INTO reviews VALUES(62,'Exclusive experience of tasting great food and great drinks.... a must try once you r in Beirut... i love this place.',5,1636469860800,1636472385866,NULL,NULL,'en');
INSERT INTO reviews VALUES(63,'Very friendly service by English speaking staff. Various different Lebanese beers can be drunk here. Small seating area outside and nice bar inside.',5,1636469860801,1636472413519,NULL,NULL,'en');
INSERT INTO reviews VALUES(64,'located in the famous hamra street in Beirut, it offers a warm atmosphere and offers tasty foods and a large variety of drinks.',4,1636469860803,1636472440245,NULL,NULL,'en');
INSERT INTO reviews VALUES(65,'Busy little place, if youre a group - best to book in advance! Great cocktail and drinks menu. Burger was great although the smoking jar was really just for creating atmosphere more than anything else.',4,1636469860804,1636472463810,NULL,NULL,'en');
INSERT INTO reviews VALUES(66,'Excellent excellent. In all means this restaurant sets the standers . What ever you order it comes with the best quality ever.',5,1636469860806,1636472477813,NULL,NULL,'en');
INSERT INTO reviews VALUES(67,'outstanding seafood restaurant , good food , excellent professional service , excellent selection of fish and lovely desert.',5,1636469860807,1636472492005,NULL,NULL,'en');
INSERT INTO reviews VALUES(68,'Incredible food, service and view. I was happy with my experience very peaceful. Sat outside by the water.',5,1636469860811,1636472503905,NULL,NULL,'en');
INSERT INTO reviews VALUES(69,'Working in the hotel industry you will come across many types of travellers. Some will be business guests, others will be tourists and visitors. Many will speak a different language other than your own. Chances are, plenty of your guests will speak English.',4,1636469860813,1636472514721,NULL,NULL,'en');
INSERT INTO reviews VALUES(70,'I consider this Restaurant one of the best in Beirut.Location wise with a Fantastic view of the Sea & Mountain,very good Food Fish or Grills,Good Service.. Desserts were offered by the Management as always.',4,1636469860814,1636472526457,NULL,NULL,'en');
INSERT INTO reviews VALUES(71,'The food was very good, service and hotel beyond expectations. Has a very nice playground for children too.',5,1636469860816,1636472542240,NULL,NULL,'en');
INSERT INTO reviews VALUES(72,'The food was great, the personnel was kind and attentive. Id recommend it all the time. Also, the place is relaxing and surrounding by plants and nature.',5,1636469860818,1636472551162,NULL,NULL,'en');
INSERT INTO reviews VALUES(73,'Excellent food, it''s a beautiful place surrounded by nature to enjoy with the family. The collaborators are very kind and the service 100 points!',5,1636469860821,1636472563085,NULL,NULL,'en');
INSERT INTO reviews VALUES(74,'Actually we enjoy our trip so much the food was everything there staff was so kind,helpful and respectful we totally recommend ! Cant wait to come back.',5,1636469860823,1636472574725,NULL,NULL,'en');
INSERT INTO reviews VALUES(75,'Excellent service and attention, food and drinks delicious , incredible environment and the entire experience is amazing!',5,1636469860824,1636472585402,NULL,NULL,'en');
INSERT INTO reviews VALUES(76,'This place is fantastic! Vegan empanadas were PHENOMENAL, as were the veggie wrap & veggie burgers. Friendly staff. Chill vibes. Delicious food. Go here!!',5,1636469860825,1636472611987,NULL,NULL,'en');
INSERT INTO reviews VALUES(77,'The best vegetarian tacos in Guatemala, in a lovely location with great service. I can also recommend the vegetarian burger and ginger lemonade.',5,1636469860826,1636472643858,NULL,NULL,'en');
INSERT INTO reviews VALUES(78,'The food at this place is great the owner he is so conscious about what he puts out to his customers the smoothies are amazing the drinks overall a great the vegan burger is to die for definitely worth a visit.',5,1636469860828,1636472670181,NULL,NULL,'en');
INSERT INTO reviews VALUES(79,'Kids are vegan traveling with us so we experienced many vegan locations and this was one of the best. They were excellent about customizing options.',5,1636469860830,1636472699632,NULL,NULL,'en');
INSERT INTO reviews VALUES(80,'Excellent food & super friendly staff. This place went far beyond my expectations! If you come to Antigua you gotta come here. Not only delicious food but also generous portions. Keep doing what your doing!',5,1636469860832,1636472730385,NULL,NULL,'en');
INSERT INTO reviews VALUES(81,'We have been invited to this magnificent restaurant, French gastronomy is a must, a real treat with very high quality wines.',5,1636469860834,1636472758927,NULL,NULL,'en');
INSERT INTO reviews VALUES(82,'An amazing dining experience in the middle of Paris. Really attentive, generous and skilled servers. We tried the 8 servings of the trip menu and it was astounding. Definitely recommendable to anyone wanting a classic Michelin experience.',5,1636469860835,1636472797227,NULL,NULL,'en');
INSERT INTO reviews VALUES(83,'We went to celebrate our anniversary, the attention and all the little details made you fall in love with the place. Dishes are expectacular.',5,1636469860836,1636472819499,NULL,NULL,'en');
INSERT INTO reviews VALUES(84,replace('Service, location and food were unlike anything else I have experienced before.\nIdeal for very special occasions, birthday/anniversary.','\n',char(10)),5,1636469860838,1636472844134,NULL,NULL,'en');
INSERT INTO reviews VALUES(85,'This was truly a Parisian experience. The food was excellent, the service was flawless, and the atmosphere was very welcoming. Will definitely dine here again.',5,1636469860839,1636472871513,NULL,NULL,'en');
INSERT INTO reviews VALUES(86,'Excellent cuisine at very fair prices makes for a tremendous valu. Our chicken and veal were impeccable.',5,1636469860841,1636472894869,NULL,NULL,'en');
INSERT INTO reviews VALUES(87,'We opted for the lunch menu which worked out at about 20 each for two courses. My cold soup starter was delightful, whilst the main course was absolutely delicious. Portions were average sized, but the food was very tasty and the service and ambiance excellent. A wonderful place for typically French meal.',5,1636469860842,1636472921710,NULL,NULL,'en');
INSERT INTO reviews VALUES(88,'We had such a lovely meal and Bistrot Instinct. The food was presented nicely and tasted even better. The service was excellent and all waiters spoke excellent English. Cannot recommend enough.',5,1636469860843,1636472945352,NULL,NULL,'en');
INSERT INTO reviews VALUES(89,'We selected this restaurant based on the good scores from FoodAdvisor... And it was even better than expected. The fish was full of flavor thanks to unusual and researched mix of ingredients, entrecote delicious, staff friendly and professional. I look forward to it again.',5,1636469860844,1636472966406,NULL,NULL,'en');
INSERT INTO reviews VALUES(90,'We enjoyed our meal very much. We especially appreciated our server, Lou, who spoke great English, and helped us with the menu. Plus, he was attentive and eager to please. Sat outside on a cute street. Good service and good food.',5,1636469860846,1636472992785,NULL,NULL,'en');
INSERT INTO reviews VALUES(91,'Intrieur absolument magnifique de l''htel, dcor comme un muse, il est possible de vous transporter sur la cte de Zanzibar au milieu de Lusaka! C''est vraiment un rgal de s''y arrter un moment et de se rgaler les yeux sur le dcor avec un dlicieux cappuccino',5,1636469991798,1636470561929,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(92,'Proprit tonnamment spacieuse au coeur d''une banlieue rsidentielle. Le parking peut tre un peu troit s''il est occup, surtout le soir. Dcor intressant comme sous les autres latitudes. 2 piscines et espaces de restauration aux ambiances diffrentes. Le service tait lent, dlicieux daiquiri aux fraises, mais le faux-filet tait vraiment trs dur et tait une dception. Donne l''impression d''tre chez soi par rapport aux grands htels de marque.',3,1636470020112,1636470600389,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(93,'Je commencerai par dire que j''tais au dpart trs enthousiaste  l''ide de visiter le restaurant de Latitude 15. Je visite la Zambie en vacances pour la premire fois et j''attendais avec impatience un bon dner pendant mon sjour, pour tre extrmement frustr par mon exprience  le restaurant. Mon ami et moi avons essay de commander 5 articles diffrents du menu, juste pour entendre qu''ils n''taient pas disponibles (une option d''alcool, les ctelettes de porc, des calamars, un gratin d''crevisses et une option de dessert).',2,1636470042342,1636470620985,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(94,replace('J''ai besoin de m''extasier sur le Seafood vol au vent ! Tout d''abord, il y a quelque chose  propos d''avoir un vol au vent entier comme plat principal et pas seulement un petit comme entre!\nJ''ai intitul ma critique "chorgraphie en bouche" car c''est ainsi que les diffrents ingrdients "dansent" ensemble dans la bouche, le poisson, les crevettes, les calamars, en couches de pte lgre sur un lit de patate douce et pinards napp d''une sauce crmeuse ! Ecrire  ce sujet me fait saliver !\nMerci!','\n',char(10)),5,1636470083901,1636471095784,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(95,'Peut-tre le lieu le plus lgant de Lusaka et un choix de manger au restaurant ou  The Other Side au bord de leur deuxime piscine. Service sympathique quoique quelque peu erratique, nourriture bonne et bien prsente.',5,1636470103116,1636471114487,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(96,'Je le recommande vivement  tout le monde. Les crevettes cajun taient excellentes. C''tait l''un de mes prfrs. Vendez-vous les ingrdients cajuns pour que je puisse les prparer  la maison? J''adorerais faire cela et ajouter aux plats  la maison. pice cajun Bobby Q.',5,1636470194228,1636471574929,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(97,'Le personnel tait sympathique, les ctes ont gliss de l''os, le macaroni au fromage tait impressionnant. Le restaurant tait un peu sombre (clairage).',5,1636470213500,1636471594169,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(98,'J''ai command un dner  rcuprer au retour d''une excursion d''une journe au chteau de Montezuma. La commande tait facile. Notre fils adolescent a command un hamburger, nous avons partag des ailes (prpares sches mais servies avec diffrentes sauces), j''ai eu une salade de poulet et mon mari a pris le sandwich  la poitrine. Nous pouvons voir pourquoi Bobby Q a 3 emplacements - toute notre nourriture tait trs savoureuse - diffrente du style du Kansas auquel nous sommes habitus, mais toutes les viandes taient savoureuses, tendres et juteuses,',4,1636470235857,1636471613213,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(99,'Grande varit de viandes et d''accompagnements pour barbecue. Les viandes ne sont pas trop en sauce. Jolie terrasse extrieure. Personnel amical. Ils sortent de dlicieux muffins au pain de mas avant votre repas',4,1636470274751,1636471641166,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(100,'Nous y sommes alls pour rendre visite  notre fille  GCU. Le samedi soir tait trop occup, alors nous y sommes alls lundi. Toutes les viandes taient bonnes et les haricots taient ok. Les Ribeye taient bons. Bons cts. Bon poulet, ctes leves, saucisses. Trs bon service. Bonne atmosphre',5,1636470312185,1636470312185,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(101,'Nous avons sjourn dans cet htel et y avons mang tous les matins. La gamme de plats tait vaste et nous n''avons jamais essay quelque chose que nous n''aimions pas. Nous avons dn ici un soir et c''tait trs bon aussi. Pari solide !',5,1636470380606,1636470380606,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(102,'J''ai ador ce restaurant  la fois le menu et le service. Gros filet australien tendre, l''un des meilleurs... le dessert tait spectaculaire... j''ai tout apprci',5,1636470421939,1636470426151,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(103,'Nous avons pass un excellent dner au restaurant Essence. La nourriture est super dlicieuse avec un got local et le service est excellent. Recommande fortement!',5,1636470456253,1636470456253,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(104,replace('J''ai t ravi de constater que ce restaurant proposait un excellent menu sans gluten pour le dner, il n''y avait donc aucun problme  expliquer mes besoins alimentaires. La nourriture tait trs bonne, mme si les portions n''taient pas grandes. Le buffet du petit djeuner tait copieux et il y avait plein d''options GF.\nTout le personnel tait exceptionnellement serviable et sympathique ; Sarah et Mint mritent une mention spciale.','\n',char(10)),5,1636471896952,1636471896952,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(105,'La nourriture tait si bonne que nous avons dmnag notre hbergement  l''htel pour profiter de leur petit-djeuner inclus. Nous avons t particulirement impressionns par Alex et Emma qui faisaient partie des serveurs du restaurant.',5,1636471923617,1636471923617,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(106,'Comme l''a dit un crivain Tchekhov  propos de l''tre humain :  tout doit tre beau , je peux dire la mme chose de ce fabuleux restaurant. J''y suis venu avec ma fille adolescente et nous avons tous les deux pass un merveilleux moment. Nous avons command de la soupe borsh, de la salade Olivie, du faux-filet partag, du pelmeni, du vareniki sucr et du smetannik. J''ai essay leur nastoika maison, aprs quoi j''en ai achet 4 bouteilles comme souvenirs  rapporter  la maison. La nourriture tait bonne, surtout je recommanderais les desserts. Le service du serveur Igor tait plus qu''excellent mais aussi assez rare pour Kharkiv.',5,1636472020033,1636472020033,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(107,'Nourriture dlicieuse et service adorable. Nous avons apprci un dner complet, des cocktails au dessert et avons apprci tout ce qui tait servi. Recommande fortement.',5,1636472050688,1636472050688,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(108,'Nous avions des assiettes diffrentes et tout tait trs joliment prsent et d''excellente qualit. Le veau tait extraordinaire et l''un des meilleurs que j''ai mang depuis une dcennie. Le gteau Napolon est incroyable !! Bravo ! Un endroit o je reviendrai et dont je me souviendrai.',5,1636472083294,1636472083294,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(109,'Nourriture dlicieuse, en particulier les cotelettes de lapin, le pt et le cheesecake (je ne me souviens pas du nom de ce dsert). Le service tait parfait, il y avait quelques problmes, je ne sais pas pourquoi, mais je peux fortement recommander ce restaurant.',4,1636472122566,1636472122566,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(110,'Bel endroit. Nourriture dlicieuse. Juste au coeur de la ville. Les prix sont assez levs.',5,1636472149595,1636472149595,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(111,'Bon endroit pour profiter d''un aprs-midi de fin d''t. La rue est calme en aot, peu de tables sont disposes dans la rue, de bons snacks et cocktails. Le service est agrable et rapide.',4,1636472233309,1636472233309,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(112,'C''est un endroit idal pour boire de la bire belge et manger de la dlicieuse nourriture. Environnement familial, prix agrables et serveurs polis, tout y est dans ce restaurant. Je reviendrai ici car  Moscou il n''y a pas assez de bons endroits belges comme celui-ci.',5,1636472253020,1636472261514,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(113,'Ma nouvelle place dans le top 3  Presnya. Intrieur confortable, personnel attentif et slection de gammes belges prfrs. Lecture de haute qualit incluse.',5,1636472284219,1636472284219,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(114,'C''est un endroit merveilleux dans ma ville prfre de Moscou, comme la petite Belgique ? C''est un endroit trs charment. Je recommande vraiment ce caf ! Parfait pour une journe spciale ou bien aprs une dure journe de travail voir meme aprs  ',5,1636472309928,1636472309928,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(115,'Bire gniale et collations dlicieuses! Endroit super confortable avec des serveurs d''hpitaux et un public sympa. L''atmosphre belge ne vous quitte jamais ici. REcommande  visiter!',5,1636472338727,1636472338727,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(116,'Charmant bar  Hamra avec de trs bonnes boissons, de la varit et un service trs heureux !!! Vaut vraiment le dtour pour l''atmosphre dcontracte et les cocktails! Excellent Negroni !!! ',5,1636472364809,1636472364809,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(117,'Exprience exclusive de dgustation de bons plats et de bonnes boissons. . .  essayer une fois si vous tes  Beyrouth. . . j''adore cet endroit.',5,1636472385806,1636472385806,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(118,'Service trs sympathique par un personnel parlant anglais. Diffrentes bires libanaises peuvent tre bues ici. Petit coin salon  l''extrieur et joli bar  l''intrieur.',5,1636472413462,1636472413462,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(119,'Situ dans la clbre rue hamra  Beyrouth, il offre une atmosphre chaleureuse et propose des plats savoureux et une grande varit de boissons.',4,1636472440125,1636472440125,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(120,'Petit endroit occup, si vous tes un groupe, mieux vaut rserver  l''avance ! Excellente carte de cocktails et de boissons. Le hamburger tait super mme si le pot  fumer tait vraiment juste pour crer une atmosphre plus que toute autre chose.',4,1636472463754,1636472463754,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(121,'Cet endroit est fantastique ! Les empanadas vgtaliennes taient PHENOMENAL, tout comme les wraps vgtariens et les hamburgers vgtariens. Personnel amical. Des vibrations relaxantes. Nourriture dlicieuse. Va ici!!',5,1636472611924,1636472611924,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(122,'Cet endroit est fantastique ! Les empanadas vgtaliennes taient PHENOMENAL, tout comme les wraps vgtariens et les hamburgers vgtariens. Personnel amical. Des vibrations relaxantes. Nourriture dlicieuse. Allez-y !!!',5,1636472643795,1636472643795,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(123,'La nourriture  cet endroit est excellente, le propritaire est tellement conscient de ce qu''il propose  ses clients. Les smoothies sont incroyables. Les boissons dans l''ensemble sont excellentes. Le hamburger vgtalien vaut vraiment le dtour.',5,1636472670124,1636472670124,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(124,'Les enfants sont vgtaliens voyageant avec nous, nous avons donc connu de nombreux endroits vgtaliens et c''tait l''un des meilleurs. Ils taient excellents pour personnaliser les options.',5,1636472699565,1636472699565,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(125,'Excellente nourriture et personnel super sympa. Cet endroit est all bien au-del de mes attentes! Si vous venez  Antigua, vous devez venir ici. Non seulement des plats dlicieux mais aussi des portions gnreuses. Continuez  faire ce que vous faites !',5,1636472730323,1636472730323,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(126,'Nous avons t invits dans ce magnifique restaurant, la gastronomie franaise est un incontournable, un vrai rgal avec des vins de trs grande qualit.',5,1636472758855,1636472758855,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(127,'Une exprience culinaire incroyable au milieu de Paris. Des serveurs vraiment attentionns, gnreux et comptents. Nous avons essay les 8 portions du "menu de voyage" et c''tait incroyable. Vraiment  recommander  tous ceux qui souhaitent vivre une exprience Michelin classique.',5,1636472797159,1636472797159,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(128,'Nous sommes alls fter notre anniversaire, l''attention et tous les petits dtails nous ont fait tomber amoureux de l''endroit.',5,1636472819440,1636472819440,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(129,'Le service, l''emplacement et la nourriture ne ressemblaient  rien d''autre que j''aie connu auparavant. Idal pour des occasions trs spciales, anniversaire/anniversaire.',5,1636472844075,1636472844075,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(130,'C''tait vraiment une exprience parisienne. La nourriture tait excellente, le service tait impeccable et l''ambiance tait trs accueillante. Je reviendrai certainement ici.',5,1636472871423,1636472871423,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(131,'Une excellente cuisine  des prix trs raisonnables, un excellent rapport qualit-prix. Notre poulet et notre veau taient impeccables.',5,1636472894801,1636472894801,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(132,'Nous avons opt pour le menu du djeuner qui nous a cot environ 20  chacun pour deux plats. Mon entre de soupe froide tait dlicieuse, tandis que le plat principal tait absolument dlicieux. Les portions taient de taille moyenne, mais la nourriture tait trs savoureuse et le service et l''ambiance excellents. Un endroit merveilleux pour un repas typiquement franais.',5,1636472921640,1636472921640,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(133,'Nous avons eu un si bon repas au Bistrot Instinct. La nourriture tait bien prsente et tait encore trs bonne. Le service tait excellent et tous les serveurs parlaient un anglais excellent. Je ne peux pas recommander assez.',5,1636472945284,1636472945284,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(134,'Nous avons slectionn ce restaurant sur la base des bonnes note sur FoodAdvisor... Et c''tait encore mieux que prvu. Le poisson tait plein de saveur grce  un mlange d''ingrdients inhabituel et recherch, une entrecte dlicieuse, un personnel amical et professionnel. Je reviendrai !',5,1636472966331,1636472966331,NULL,NULL,'fr-FR');
INSERT INTO reviews VALUES(135,'Nous avons beaucoup apprci notre repas. Nous avons particulirement apprci notre serveur, Lou, qui parlait trs bien anglais et nous a aid avec le menu. De plus, il tait attentif et dsireux de plaire. Assis dehors dans une jolie rue. Bon service et bonne nourriture.',5,1636472992720,1636472992720,NULL,NULL,'fr-FR');
