INSERT INTO articles VALUES(1,'Here''s why you have to try basque cuisine, according to a basque chef','here-s-why-you-have-to-try-basque-cuisine-according-to-a-basque-chef',1636464799948,1685703439584,1663839000208,3,1,'en','<p>Thanks to <a href="https://www.huffpost.com/entry/how-to-measure-the-restau_b_5475536">Ferran Adri</a>, tapas, and a fascination with all things pork -- from chorizo to chicharrones -- Spanish cuisine has been a star in the food world in recent years. But a less familiar part of Spanish cuisine is Basque -- considerably unique and different from the broader Spanish cuisine that has been exported across the globe. Basque cuisine is worth getting to know, however, and with an influx of Basque-inspired restaurants in food-forward cities like New York, it appears that this culinary tradition is gaining the foothold it deserves.</p><p>Basque country lies in the North of Spain near the Bay of Biscay and in South Western France. With fertile ground for grains and vineyards in an area called lava, and good land for livestock breeding in Vizcaya and Guipzcoa, Basque country has a rich culinary heritage. It''s no wonder then that today the region boasts <a href="http://www.euskoguide.com/food-drink-basque-country/michelin-star-restaurants.html">almost 40 Michelin-starred restaurants</a>.</p><p>I spoke to the executive chef and owner of the new Basque-inspired restaurant <a href="http://huertasnyc.com/t">Huertas</a> in New York City to learn more about the unique cuisine. Ten years ago, after working in some of New York''s most prominent restaurants, chef Jonah Miller took off for Northern Spain to learn more. In April of this year, he opened his first restaurant, dedicated to the food he studied and fell in love with.</p><p><strong>I asked Jonah to describe some quintessential Basque dishes, and the overarching themes were salt cod and peppers.</strong></p><p><i>Salt Cod (in many forms), including:</i><br>- Kokotxas al Pil-Pil - Fish cheeks and throats in a "pil-pil" sauce, which refers to the sound made when shaking a cazuela to activate the natural gelatin in the fish cheeks.<br>- Tortilla de Bacalao - A salt cod omelet.<br>- Porrusalda - Potato, leek, salt cod soup.<br>Piperrada - Sauteed peppers (they use lots of peppers), onions, garlic and tomato, often served with a fried egg.<br>Stuffed Piquillo Peppers.<br>Marmitako - Tuna with potato and pepper stew.</p><p><strong>I also asked what some quintessential Basque beverages might be.</strong></p><blockquote><p>Sidra (cider), which is much dryer and funkier than ciders we are familiar with, and Txakoli, slightly effervescent white wine. Both are low in alcohol and highly acidic -- perfect to drink with pintxos.</p></blockquote><p><strong>So what are pintxos?</strong></p><blockquote><p>"Pintxos are small, composed bites that unlike tapas, aren''t meant to be shared," explained Miller. Fans of tapas but not always down to share every bite, we like the sound of pintxos. Basque restaurants are best known for pintxos, and at his restaurant, Miller naturally serves a variety.&nbsp;</p></blockquote><p>Among his favorites are:<br><i>Gildas - White anchovy, olive, and pickled pepper skewer (named after the 1946 Rita Hayworth role).</i><br><i>Soft Boiled Quail Egg with Black Anchovy and Piquillo Peppers.</i><br><i>Fried Eggplant with Honey and Goat Cheese (local eggplant just started).</i><br><i>Wood-Fired Chorizo with Pickled Carrots.</i></p><p><img src="/uploads/55_3a3cb7ffba_cf157a700b.jpg" alt="Pintxos">)</p><p><strong>Other than Pintxos, what are more distinguishing features of Basque cuisine that you won''t find anywhere else?</strong></p><blockquote><p>Lots of salt cod. As far back at the 15th century Basques were the best ship builders in Europe and dominated the whaling trade. When the whaling trade dried up, they began going further into the north Atlantic to fish for cod, which they salted aboard the ship as a means of preservation and then brought home. So even though cod is not present in the waters around Spain, it is the fish most commonly used in the Basque country (though almost always dried). They use more Foie Gras than other areas of Spain.</p></blockquote><p><strong>Miller serves a lot of egg dishes at Huertas, so I wondered too how important eggs were in Basque cuisine.</strong></p><blockquote><p>In the Basque country, they enjoy eggs at all times of day throughout Spain... Eggs are often the canvas for beautiful seafood, produce, or charcuterie, such as wild mushrooms, local asparagus, Jamon...</p></blockquote><p><strong>I asked what brought him to Northern Spain in the first place and what drew him to the cuisine.</strong></p><blockquote><p>Ten years ago when I was growing up working in kitchens, Spain was at the forefront of influencing modern cooking techniques. So that was largely what attracted me to studying abroad in Madrid (as well as honing my Spanish speaking, which is helpful in NYC kitchens), as well as not knowing much about Spanish cuisine and looking forward to learning something new. When in Spain, I came to appreciate not the modern cooking, but how great the old-school pintxo and tapas bars were, how fun they were to dine in, and felt that we didn''t have much representation for that experience in New York. Being a native New Yorker, I think we should have the best of everything available here, and wanted to bring more great Spanish food to our city.</p></blockquote><blockquote><p>The food and culture of the north of Spain translate better than the south of Spain to New York. For one thing, being closer to the rest of Europe, the north is more cosmopolitan and a bit more diverse. Also, the climate in the north (and accordingly produce) is not far off from that of New York.</p></blockquote><p><strong>Now I''m hungry. I asked what a typical way to start and end a Basque meal is.</strong></p><blockquote><p>To start, Txakolina and simply cooked seafood. [To finish,] there are some delicious Basque vermouths, which are a bit sweet and are had after dinner or often in the afternoon (some of which we offer, as well as making our own). They do make caramels and toffees, as well as Turron, an almond nougat. All traditional ends to a meal. There are also many cakes and tarts that are traditional.</p></blockquote><p><strong>So now that I''m ready to dive headfirst into Basque cuisine, what would be an approachable dish to try making at home?</strong></p><blockquote><p>Pintxos!! Go to Despana (a Spanish specialty foods store), pick up one or two cheeses, one or two cured meats, anchovies, a tin of seafood; the greenmarket for some seasonal produce and local honey; get some good bread, toothpicks, and start trying out different combinations. Try this cheese with honey and shaved carrots, those anchovies with tomato on toast.<br>&nbsp;</p></blockquote>');
INSERT INTO articles VALUES(2,'What are chinese hamburgers and why aren''t you eating them?','what-are-chinese-hamburgers-and-why-aren-t-you-eating-them',1636637599948,1685629970984,1663850208312,3,1,'en','<p>The world''s first hamburger doesn''t come from where you think it comes from. It wasn''t invented in the United States, and it didn''t originate in Germany. No, the world''s first hamburger comes from China.</p><h3>Wait, what?</h3><p>If you''re scratching your head right now, you''re not alone. But Chinese hamburgers are very real and they definitely predate the <a href="https://www.huffpost.com/entry/the-16-essential-regional_b_5682151">hamburgers we call our own</a> in the U.S. Known as rou jia mo, which translates to "meat burger" or "meat sandwich," they consist of chopped meat inside a pita-like bun, and they''ve been around since the Qin dynasty, from about 221 BC to 207 BC. Despite the differences between this Chinese street food and our American-style <a href="https://www.huffpost.com/entry/perfect-way-to-eat-burger_n_4704188">burgers</a>, the rou jia mo "<a href="http://www.marcussamuelsson.com/news/street-food-rou-jia-mo-from-china">has been called the world''s first hamburger</a>".</p><p>The rou jia mo originated in the Shaanxi Province of China, and is now eaten all over the country. It''s typically prepared and eaten on the street. The dough for the bun, or mo, consists of a simple mixture of wheat flour, water and maybe yeast. Of course recipes may vary, but this basic equation makes for a chewy and subtle pillow for the delicious filling. While the mo is <a href="https://www.starchefs.com/cook/savory/technique/rou-jia-mo-chinese-hamburger">traditionally baked in a clay oven</a>, today it''s often fried in a pan. They may look a little like <a href="https://www.huffpost.com/entry/bao-facts_n_5000963">Chinese steamed buns or baos</a>, but the dough for those is, of course, steamed, not baked or fried.</p><figure class="image image-style-side"><img src="/uploads/fe006ed91f619568081af52979b77af3_52cac17456.jpeg" alt="fe006ed91f619568081af52979b77af3.jpeg"></figure><p>The meat filling might consist of chopped pork, beef, lamb, or chicken that has been stewed with a variety of spices, like ginger, cloves, coriander, and star anise. You might also find herbs like cilantro or greens like lettuce garnishing the sandwich.</p><p>If you''ve never had a Chinese hamburger, now is as great a time as any to try one. <a href="http://www.chinasichuanfood.com/chinese-hamburger-pork-belly-buns/">See here for a recipe for rou ji mo</a>, or watch the video below for step-by-step instructions for another great Chinese hamburger recipe.</p><p><br>&nbsp;</p>');
INSERT INTO articles VALUES(3,'7 Places worth visiting for the food alone','7-places-worth-visiting-for-the-food-alone',1636723999948,1685705400075,1685705400075,3,1,'en','<blockquote><p>There is no love sincerer than the love of food&nbsp;</p></blockquote><p>said George Bernard Shaw, and let us also add that there''s arguably no better way to explore a culture than to eat voraciously while traveling. Yes, there are many five-star restaurants worth booking an entire trip for, but it''s equally important to savor classic treats from across the world.</p><h3>Paella in Valencia, Spain</h3><figure class="image image-style-side image_resized" style="width:25%;"><img src="/uploads/5b9eeba22100003000c61e59_9098d9fb0a_176b2163c1_4b0b601b3c.jpeg" alt="Paella in Valencia"></figure><p>Its this classic rice-based dish that first pops to mind when thinking of Spanish gastronomy. For the best there is, head to the source: Valencia. And dont forget to scrape the bottom of the pan for heavenly bites of crunchy rice, or socarrat: the most flavorful arroz ever to land on your palate.</p><p>&nbsp;</p><h3>&nbsp;</h3><h3>&nbsp;</h3><h3>Nasi Lemak in Malaysia</h3><figure class="image image_resized" style="width:50%;"><img src="/uploads/5b9eeba22400005100542e38_cf4839f0ad_84f89b8451_742b9a1759.jpeg" alt="Nasi Lemak"></figure><p>Malaysias national dish, nasi lemak is a fragrant coconut-milk rice mixture, served with sambal sauce, fried crispy anchovies, toasted peanuts, and cucumber and cooked with screw pine (pandan) leaves. Available on almost every street corner, this much-loved classic hits all the notes.</p><h3>Pintxos in San Sebastin, Spain</h3><p><img class="image_resized" style="width:25%;" src="/uploads/5b9eeba32500003500370d46_7d51fc80cd_783924b96a_bdc848856f.jpeg" alt="Pintxos in San Sebastin"></p><p>Among the most highly ranked cities for Michelin-starred restaurants, San Sebastin boasts pintxos (the equivalent of small tapas) with ber-creative takes on classics and beyond. Spains haute cuisine shines in this culinary paradise on the Basque coast.</p><h3>&nbsp;</h3><h3>Pastel de Nata in Lisbon</h3><figure class="image image-style-side image_resized" style="width:25%;"><img src="/uploads/5b9eeba53c00005b000abbf4_be4ab6d075_e909882796_3908e6e816.jpeg" alt="Pastel de Nata"></figure><p>The most iconic Portuguese pastry, the <a href="http://www.bbc.com/travel/story/20111107-a-bit-of-history-in-every-sweet-bite">pastel de nata</a> is a sublime custard tart with hints of lemon, cinnamon, and vanilla. Buttery goodness in the middle, crunchy sweetness on topwhats not to love?</p><h3>&nbsp;</h3><h3>&nbsp;</h3><h3>&nbsp;</h3><h3>Mole in Puebla, Mexico</h3><p><img class="image_resized" style="width:25%;" src="/uploads/5b9eeba62100003100c61e5b_d99dbc2910_75979ebd04_7afc2d1a5c.jpeg" alt="Mole in Puebla"></p><p>Mole, a specialty in the Mexican city of Puebla, is a labor of love. The spicy-sweet combination of this rich, chocolate-colored sauce takes arduous preparation and packs ingredients such as ancho chiles, spices like anise and coriander, sesame seeds, almonds, peanuts, stale bread, brown sugar, raisins, chocolate, and ripe plantains. The culminating dish is fit for the gods.</p><h3>Sichuan Hot Pot in China</h3><p><img class="image_resized" style="width:50%;" src="/uploads/5b9eeba82200005600da3822_01759bd55b_b46108e1aa_a310f83ff9.jpeg" alt="Sichuan Hot Pot"></p><p>This isnt for the faint of heart. But if youre an extreme spice lover, youll welcome the tears that come from the hot pots perfect nexus of pain and pleasure.</p><h3>Tagine in Morocco</h3><p><img class="image_resized" style="width:50%;" src="/uploads/5b9eeba93c000032000abbf6_12bb2e5346_9e0dac4fca_73bf6480cb.jpeg" alt="Tagine in Morocco"></p><p>This slow-cooked savory stew, typically made with sliced meat, poultry, or fish and lots of herbs and spices, is true Moroccan soul food. Cooked for hours in a clay cooking pot with a conical lid (known as a tagine), this irresistible dish is served with couscous or bread and can be found all over Morocco.</p>');
INSERT INTO articles VALUES(4,'If you don''t finish your plate in these countries, you might offend someone','if-you-don-t-finish-your-plate-in-these-countries-you-might-offend-someone',1636983199948,1685703575148,1663850153899,3,1,'en','<p>Across the globe, there are many cultural differences that define each country. As a traveler, its important to educate yourself on what you should and shouldnt do when visiting a new locale.</p><p>And since food is such a big part of travel, its important to learn the dining etiquette of each nation. It differs greatly from place to place. For example, in many areas of China its considered a compliment to [burp after a meal](https://www.buzzfeed.com/adamellis/surprising-food-etiquette-rules-from-around-the-world)  a sign that youve eaten well  while stateside, that same act will get you some serious side-eye.</p><p>One easy way you can commit a faux pas while eating abroad is with your plate  should you wipe it clean or leave some food? It all depends on where you are.</p><p>Here are four nations where what you do with your plate matters. Study up before you make another big trip.</p><h3>India</h3><p>In India, you <a href="https://www.thrillist.com/eat/nation/international-food-customs-8-weird-food-etiquette-trends-from-around-the-world-thrillist-nation">should finish everything</a> that is on your plate because it is <a href="http://www.culturewavesglobal.com/india-etiquette-">considered a respect for the served food</a>, and food in India is considered sacred. In South India, where food can be served on a banana leaf, it is polite to fold your leaf over from the top  not from the bottom, because <a href="http://www.cntraveler.com/stories/2007-10-17/etiquette-101-india">that indicates you were not satisfied</a>.</p><h3>Japan</h3><p>The same is true about finishing your plate in Japan. The Japanese consider it <a href="http://www.japan-talk.com/jt/new/in-Japan-you-need-to-finish-your-plate">rude to leave food on your plate</a>, whether at home or at a restaurant. Its related to one of the fundamental concepts in Japanese culture, <a href="http://www.abc.net.au/radionational/programs/philosopherszone/avoiding-waste-with-the-japanese-concept-of-''mottainai''/6722720">mottainai</a>, which is a feeling of regret at having wasted something.</p><h3>China</h3><p>In China, however, leaving behind an empty plate is a <a href="https://www.thrillist.com/eat/nation/international-food-customs-8-weird-food-etiquette-trends-from-around-the-world-thrillist-nation">sign to the host that youre still hungry</a>. If you dont want to eat more food, consider leaving a little behind to let the host know <a href="http://www.healthytravelblog.com/2012/08/10/travel-etiquette-part-3-eating-without-embarrassing-yourself/">you have had enough</a>.</p><p>&nbsp;</p><h3>Ethiopia</h3><p>Ethiopians dont even bother with plates. Individual plates <a href="https://www.lonelyplanet.com/asia/travel-tips-and-articles/76513?lpaffil=lp-affiliates">are considered wasteful</a>. Folks share meals off of <a href="http://www.foodbycountry.com/Algeria-to-France/Ethiopia.html">one big communal plate</a> and generally eat with their hands using injera  a type of flatbread  to pick up the food. So, dont even think about asking for your own plate.<br>&nbsp;</p>');
INSERT INTO articles VALUES(9,'7 endroits  visiter pour la nourriture','7-endroits-a-visiter-pour-la-nourriture',1637155999948,1685629950963,1637242399948,3,1,'fr-FR','<blockquote><p>Il n''y a pas d''amour plus sincre que l''amour de la nourriture</p></blockquote><p>a dclar George Bernard Shaw, et ajoutons galement qu''il n''y a sans doute pas de meilleure faon d''explorer une culture que de manger avec voracit en voyageant. Oui, il existe de nombreux restaurants cinq toiles pour lesquels il vaut la peine de rserver un voyage entier, mais il est tout aussi important de savourer des friandises classiques du monde entier.</p><h3>Paella  Valence, Espagne</h3><figure class="image image-style-side"><img src="/uploads/5b9eeba22100003000c61e59_9098d9fb0a_176b2163c1_4b0b601b3c.jpeg" alt="Paella in Valencia"></figure><p>C''est ce plat classique  base de riz qui vient d''abord  l''esprit lorsque l''on pense  la gastronomie espagnole. Pour le meilleur, rendez-vous  la source : Valence. Et n''oubliez pas de gratter le fond de la casserole pour des bouches paradisiaques de riz croquant ou de socarrat : l''arroz le plus savoureux qui ait jamais atterri sur votre palais.</p><p>&nbsp;</p><p>&nbsp;</p><h3>Nasi Lemak en Malaisie</h3><figure class="image image_resized" style="width:50%;"><img src="/uploads/5b9eeba22400005100542e38_cf4839f0ad_84f89b8451_742b9a1759.jpeg" alt="Nasi Lemak"></figure><p>Le plat national de la Malaisie, le nasi lemak est un mlange de riz parfum au lait de coco, servi avec une sauce sambal, des anchois croustillants frits, des cacahutes grilles et du concombre et cuit avec des feuilles de pin  vis (pandan). Disponible  presque tous les coins de rue, ce classique trs apprci frappe toutes les notes.</p><h3>Pintxos  Saint-Sbastien, Espagne</h3><p><img src="/uploads/5b9eeba32500003500370d46_7d51fc80cd_783924b96a_bdc848856f.jpeg" alt="Pintxos in San Sebastin"></p><p>Parmi les villes les mieux classes pour les restaurants toils Michelin, Saint-Sbastien propose des pintxos (l''quivalent de petites tapas) avec des versions ultra cratives des classiques et au-del. La haute cuisine espagnole brille dans ce paradis culinaire de la cte basque.</p><h3>Pastel de Nata  Lisbonne</h3><p><img src="/uploads/5b9eeba53c00005b000abbf4_be4ab6d075_e909882796_3908e6e816.jpeg" alt="Pastel de Nata"></p><p>La ptisserie portugaise la plus emblmatique, le <a href="http://www.bbc.com/travel/story/20111107-a-bit-of-history-in-every-sweet-bite">pastel de nata</a> est une sublime tarte  la crme avec des notes de citron, de cannelle et de vanille. Bont beurre au milieu, douceur croquante sur le dessus, qu''est-ce qu''il ne faut pas aimer ?</p><h3>Mole  Puebla, Mexique</h3><p><img src="/uploads/5b9eeba62100003100c61e5b_d99dbc2910_75979ebd04_7afc2d1a5c.jpeg" alt="Mole in Puebla"></p><p>La taupe, une spcialit de la ville mexicaine de Puebla, est un travail d''amour. La combinaison pice-douce de cette sauce riche et chocolate ncessite une prparation ardue et contient des ingrdients tels que des piments ancho, des pices comme l''anis et la coriandre, des graines de ssame, des amandes, des arachides, du pain rassis, de la cassonade, des raisins secs, du chocolat et des bananes plantains mres. . Le plat culminant est digne des dieux.</p><h3>Hot Pot du Sichuan en Chine</h3><p><img src="/uploads/5b9eeba82200005600da3822_01759bd55b_b46108e1aa_a310f83ff9.jpeg" alt="Sichuan Hot Pot"></p><p>Ce n''est pas pour les mes sensibles. Mais si vous tes un amoureux extrme des pices, vous accueillerez les larmes qui jaillissent du lien parfait de douleur et de plaisir de la fondue.</p><h3>Tajine au Maroc</h3><p><img src="/uploads/5b9eeba93c000032000abbf6_12bb2e5346_9e0dac4fca_73bf6480cb.jpeg" alt="Tagine in Morocco"></p><p>Ce ragot sal cuit lentement, gnralement compos de tranches de viande, de volaille ou de poisson et de beaucoup d''herbes et d''pices, est une vritable cuisine de l''me marocaine. Cuit pendant des heures dans une marmite en terre cuite  couvercle conique (appele tajine), ce plat irrsistible est servi avec du couscous ou du pain et se retrouve partout au Maroc.</p>');
INSERT INTO articles VALUES(10,'Voici pourquoi il faut essayer la cuisine basque, selon un chef basque','voici-pourquoi-il-faut-essayer-la-cuisine-basque-selon-un-chef-basque',1637242399948,1685703439606,1663851600069,3,1,'fr-FR','<p>Grce  <a href="https://www.huffpost.com/entry/how-to-measure-the-restau_b_5475536">Ferran Adri</a>, des tapas et une fascination pour tout ce qui concerne le porc - du chorizo aux chicharrones - la cuisine espagnole a t une star dans le monde de l''alimentation ces dernires annes. Mais une partie moins familire de la cuisine espagnole est basque - considrablement unique et diffrente de la cuisine espagnole plus large qui a t exporte  travers le monde. Cependant, la cuisine basque vaut la peine d''tre connue, et avec un afflux de restaurants d''inspiration basque dans des villes gourmandes comme New York, il semble que cette tradition culinaire prenne la place qu''elle mrite.</p><p>Le Pays Basque se situe au nord de l''Espagne prs du golfe de Gascogne et dans le sud-ouest de la France. Avec un sol fertile pour les crales et les vignobles dans une rgion appele lava, et de bonnes terres pour l''levage en Biscaye et Guipzcoa, le pays basque possde un riche patrimoine culinaire. Il n''est donc pas tonnant qu''aujourd''hui la rgion compte <a href="http://www.euskoguide.com/food-drink-basque-country/michelin-star-restaurants.html">presque 40 restaurants toils Michelin</a>.</p><p>J''ai parl au chef excutif et propritaire du nouveau restaurant d''inspiration basque <a href="http://huertasnyc.com/t">Huertas</a>  New York pour en savoir plus sur la cuisine unique. Il y a dix ans, aprs avoir travaill dans certains des restaurants les plus en vue de New York, le chef Jonah Miller s''est envol pour le nord de l''Espagne pour en savoir plus. En avril de cette anne, il a ouvert son premier restaurant, ddi  la nourriture qu''il a tudie et dont il est tomb amoureux.</p><p><strong>J''ai demand  Jonah de dcrire certains plats basques par excellence, et les thmes dominants taient la morue sale et les poivrons.</strong></p><p><i>Morue sale (sous de nombreuses formes), y compris</i>:<br>- Kokotxas al Pil-Pil - Joues et gorges de poisson dans une sauce "pil-pil", qui fait rfrence au son mis en secouant une cazuela pour activer la glatine naturelle dans les joues de poisson.<br>- Tortilla de Bacalao - Une omelette  la morue sale.<br>- Porrusalda - Soupe de pommes de terre, poireaux, morue sale.<br>Piperrada - Poivrons sauts (ils utilisent beaucoup de poivrons), oignons, ail et tomate, souvent servis avec un uf au plat.<br>Poivrons de Piquillo farcis.<br>Marmitako - Thon avec ragot de pommes de terre et poivrons.</p><p><strong>J''ai galement demand quelles pourraient tre les boissons basques par excellence.</strong></p><blockquote><p>Sidra (cidre), beaucoup plus sec et funky que les cidres que nous connaissons, et Txakoli, vin blanc lgrement effervescent. Les deux sont faibles en alcool et trs acides - parfaits  boire avec des pintxos.</p></blockquote><p><strong>Alors, que sont les pintxos ?</strong></p><blockquote><p>"Les pintxos sont de petites bouches composes qui, contrairement aux tapas, ne sont pas destines  tre partages", a expliqu Miller. Amateurs de tapas mais pas toujours prts  partager chaque bouche, on aime le son des pintxos. Les restaurants basques sont surtout connus pour les pintxos, et dans son restaurant, Miller sert naturellement une varit. Parmi ses favoris figurent :<br><i>Gildas - Brochette d''anchois blancs, d''olives et de poivrons marins (nomme d''aprs le rle de Rita Hayworth en 1946).</i><br><i>Egguf de caille mollet aux anchois noirs et piments piquillos.</i><br><i>Aubergine frite au miel et au fromage de chvre (l''aubergine locale vient de commencer).</i><br><i>Chorizo au feu de bois avec carottes marines.</i></p></blockquote><p><img src="/uploads/55_3a3cb7ffba_cf157a700b.jpg" alt="Pintxos"></p><p><strong>Au-del des pintxos, quelles sont les caractristiques les plus distinctives de la cuisine basque que vous ne trouverez nulle part ailleurs ?</strong></p><blockquote><p>Beaucoup de morue sale. Ds le XVe sicle, les Basques taient les meilleurs constructeurs de navires d''Europe et dominaient le commerce de la chasse  la baleine. Lorsque le commerce de la chasse  la baleine s''est tari, ils ont commenc  aller plus loin dans l''Atlantique Nord pour pcher la morue, qu''ils ont sale  bord du navire comme moyen de conservation et qu''ils ont ensuite ramene chez eux. Ainsi, mme si la morue n''est pas prsente dans les eaux autour de l''Espagne, c''est le poisson le plus couramment utilis au Pays basque (bien que presque toujours sch). Ils utilisent plus de Foie Gras que d''autres rgions d''Espagne.</p></blockquote><p><strong>Miller sert beaucoup de plats aux ufs  Huertas, alors je me suis demand aussi quelle tait l''importance des ufs dans la cuisine basque.</strong></p><blockquote><p>[Au Pays basque] on se rgale d''ufs  toute heure de la journe dans toute l''Espagne... Les ufs sont souvent la toile de beaux fruits de mer, produits frais ou charcuterie, comme les champignons sauvages, les asperges locales, le jambon...</p></blockquote><p><strong>J''ai demand ce qui l''avait amen dans le nord de l''Espagne en premier lieu et ce qui l''avait attir vers la cuisine.</strong></p><blockquote><p>Il y a dix ans, lorsque j''ai grandi dans la cuisine, l''Espagne tait  l''avant-garde pour influencer les techniques de cuisson modernes. C''est donc en grande partie ce qui m''a attir  tudier  l''tranger  Madrid (ainsi qu'' perfectionner mon espagnol, ce qui est utile dans les cuisines de New York), ainsi qu'' ne pas trop connatre la cuisine espagnole et  avoir hte d''apprendre quelque chose de nouveau. Quand en Espagne, j''ai appris  apprcier non pas la cuisine moderne, mais  quel point les bars  pintxo et  tapas  l''ancienne taient formidables,  quel point ils taient amusants  dner et j''ai senti que nous n''avions pas beaucoup de reprsentation pour cette exprience  New York. tant originaire de New York, je pense que nous devrions avoir le meilleur de tout ce qui est disponible ici et que nous voulions apporter plus de bonne cuisine espagnole dans notre ville.</p></blockquote>');
INSERT INTO articles VALUES(11,'Si vous ne finissez pas votre assiette dans ces pays, vous pourriez offenser quelqu''un','si-vous-ne-finissez-pas-votre-assiette-dans-ces-pays-vous-pourriez-offenser-quelqu-un',1637674399948,1685703575121,1637847199948,3,1,'fr-FR','<p>Partout dans le monde, il existe de nombreuses diffrences culturelles qui dfinissent chaque pays. En tant que voyageur, il est important de vous renseigner sur ce que vous devriez et ne devriez pas faire lorsque vous visitez un nouveau lieu.</p><p>Et puisque la nourriture est une si grande partie du voyage, il est important d''apprendre l''tiquette  manger de chaque nation. Il diffre grandement d''un endroit  l''autre. Par exemple, dans de nombreuses rgions de Chine, il est considr comme un compliment de <a href="https://www.buzzfeed.com/adamellis/surprising-food-etiquette-rules-from-around-the-world">roter aprs un repas</a>  un signe que vous avez bien mang  alors qu''aux tats-Unis, ce mme acte vous attirera un srieux il de ct.</p><p>Un moyen facile de commettre un faux pas en mangeant  l''tranger est d''utiliser votre assiette  devez-vous l''essuyer ou laisser de la nourriture ? Tout dpend de l''endroit o vous vous trouvez.</p><p>Voici quatre nations o ce que vous faites avec votre assiette compte. tudiez avant de faire un autre grand voyage.</p><h3>Inde</h3><p>En Inde, vous <a href="https://www.thrillist.com/eat/nation/international-food-customs-8-weird-food-etiquette-trends-from-around-the-world-thrillist-nation">devriez tout finir</a> qui est dans votre assiette car elle est <a href="http://www.culturewavesglobal.com/india-etiquette-">considre comme un respect pour la nourriture servie</a>, et la nourriture en Inde est considre comme sacre. En Inde du Sud, o la nourriture peut tre servie sur une feuille de bananier, il est poli de replier votre feuille par le haut et non par le bas, car <a href="http://www.cntraveler.com /stories/2007-10-17/etiquette-101-india">cela indique que vous n''tiez pas satisfait</a>.</p><h3>Japon</h3><p>Il en va de mme pour la finition de votre assiette au Japon. Les Japonais trouvent [impoli de laisser de la nourriture dans votre assiette](http://www.japan-talk.com/jt/new/in-Japan-you-need-to-finish-your-plate), que ce soit  la maison ou au restaurant. Il est li  l''un des concepts fondamentaux de la culture japonaise, [mottainai](http://www.abc.net.au/radionational/programs/philosopherszone/avoiding-waste-with-the-japanese-concept-of-''mottainai ''/6722720), qui est un sentiment de regret d''avoir gaspill quelque chose.</p><h3>Chine</h3><p>En Chine, cependant, laisser une assiette vide est un <a href="https://www.thrillist.com/eat/nation/international-food-customs-8-weird-food-tiquette-tendances-de-dans-le-monde-thrillist-nation">signe  l''hte que vous avez encore faim</a>. Si vous ne voulez pas manger plus de nourriture, envisagez de laisser un peu de ct pour informer l''hte <a href="http://www.healthytravelblog.com/2012/08/10/travel-etiquette-part- 3-manger-sans-s''embarrasser/">vous en avez assez</a>.</p><h3><br>thiopie</h3><p>Les thiopiens ne se soucient mme pas des assiettes. Les plaques individuelles <a href="https://www.lonelyplanet.com/asia/travel-tips-and-articles/76513">sont considres comme du gaspillage</a>. Les gens partagent leurs repas sur <a href="http://www.foodbycountry.com/Algeria-to-France/Ethiopia.html">une grande assiette commune</a>, et mangent gnralement avec leurs mains en utilisant l''injera  un type de pain plat  pour choisir jusqu'' la nourriture. Alors, ne pensez mme pas  demander votre propre assiette.</p>');
INSERT INTO articles VALUES(12,'Que sont les hamburgers chinois et pourquoi n''en mangez-vous pas ?','que-sont-les-hamburgers-chinois-et-pourquoi-n-en-mangez-vous-pas',1637933599948,1685629973817,1638192799948,3,1,'fr-FR','<p>Le premier hamburger au monde ne vient pas d''o vous pensez qu''il vient. Il n''a pas t invent aux tats-Unis et il n''est pas originaire d''Allemagne. Non, le premier hamburger au monde vient de Chine.</p><h3>Attendez, quoi ?</h3><p>Si vous vous grattez la tte en ce moment, vous n''tes pas seul. Mais les hamburgers chinois sont bien rels et ils sont certainement antrieurs aux <a href="https://www.huffpost.com/entry/the-16-essential-regional_b_5682151">hamburgers que nous appelons les ntres</a> aux tats-Unis Connu sous le nom de rou jia mo, qui se traduit   hamburger  la viande  ou  sandwich  la viande , ils consistent en de la viande hache  l''intrieur d''un petit pain de type pita, et ils existent depuis la dynastie Qin, d''environ 221 avant JC  207 avant JC. Malgr les diffrences entre cette cuisine de rue chinoise et nos <a href="https://www.huffpost.com/entry/perfect-way-to-eat-burger_n_4704188">burgers</a>  l''amricaine, le rou jia mo "<a href="http://www.marcussamuelsson.com/news/street-food-rou-jia-mo-from-china">a t appel le premier hamburger au monde</a>".</p><p>Le rou jia mo est originaire de la province chinoise du Shaanxi et est maintenant consomm dans tout le pays. Il est gnralement prpar et mang dans la rue. La pte pour le petit pain, ou mo, se compose d''un simple mlange de farine de bl, d''eau et peut-tre de levure. Bien sr, les recettes peuvent varier, mais cette quation de base en fait un oreiller moelleux et subtil pour une dlicieuse garniture. Alors que le mo est <a href="https://www.starchefs.com/cook/savory/technique/rou-jia-mo-chinese-hamburger">traditionnellement cuit dans un four d''argile</a>, aujourd''hui, il est souvent frit dans une pole. Ils peuvent ressembler un peu  <a href="https://www.huffpost.com/entry/bao-facts_n_5000963">des petits pains ou des baos cuits  la vapeur chinois</a>, mais la pte pour ceux-ci est, bien sr, cuite  la vapeur, pas cuite ni frite.</p><figure class="image image-style-side"><img src="/uploads/f59304_eda97f6eaaad4c96a80de0d235813138_mv2_128aac85a3_dc9e03b0f1.webp" alt="Chinese hamburgers"></figure><p>La garniture  base de viande peut tre compose de porc, de buf, d''agneau ou de poulet hach qui a t mijot avec une varit d''pices, comme le gingembre, les clous de girofle, la coriandre et l''anis toil. Vous pouvez galement trouver des herbes comme la coriandre ou des lgumes verts comme la laitue pour garnir le sandwich.</p><p>Si vous n''avez jamais mang de hamburger chinois, c''est le moment idal pour en essayer un. <a href="http://www.chinasichuanfood.com/chinese-hamburger-pork-belly-buns/">Voir ici pour une recette de rou ji mo</a>, ou regardez la vido ci-dessous pour des instructions tape par tape pour un autre grand chinois recette de hamburgers.<br>&nbsp;</p>');
